INSERT INTO cor_major_groups (code, name, description) 
        VALUES ('7', 'Muncitorii calificaţi şi asimilaţii acestora aplică cunoştinţe şi competenţe specifice în domenii privind construirea şi întreţinerea clădirilor, ridicarea structurilor metalice, reglarea maşinilor-unelte sau fabricarea, montarea, întreţinerea şi repararea utilajelor, echipamentelor sau uneltelor, executarea lucrărilor specifice de imprimare şi producere sau procesare a produselor alimentare, textile, din lemn, metal sau alte articole, inclusiv a obiectelor de artizanat. Lucrările sunt executate manual sau cu ajutorul unor unelte cu acţionare manuală şi altor tipuri de unelte, ce sunt folosite pentru a reduce cantitatea de efort fizic şi timpul necesar pentru sarcini specifice, precum şi pentru îmbunătăţirea calităţii produselor. Sarcinile efectuate necesită o înţelegere a tuturor etapelor procesului de producţie, a materialelor şi uneltelor folosite, precum şi a naturii şi scopului produsului final. ', 'Muncitorii calificaţi şi asimilaţii acestora aplică cunoştinţe şi competenţe specifice în domenii privind construirea şi întreţinerea clădirilor, ridicarea structurilor metalice, reglarea maşinilor-unelte sau fabricarea, montarea, întreţinerea şi repararea utilajelor, echipamentelor sau uneltelor, executarea lucrărilor specifice de imprimare şi producere sau procesare a produselor alimentare, textile, din lemn, metal sau alte articole, inclusiv a obiectelor de artizanat. Lucrările sunt executate manual sau cu ajutorul unor unelte cu acţionare manuală şi altor tipuri de unelte, ce sunt folosite pentru a reduce cantitatea de efort fizic şi timpul necesar pentru sarcini specifice, precum şi pentru îmbunătăţirea calităţii produselor. Sarcinile efectuate necesită o înţelegere a tuturor etapelor procesului de producţie, a materialelor şi uneltelor folosite, precum şi a naturii şi scopului produsului final. ')
